import React from 'react';
import './App.css';
import Todos from './components/Todos';

function App() {

  state = {
    todos:[
      {
        id:1,
        title:"Take out trash",
        completed:"False"
      },{
        id:2,
        title:"Wash car",
        completed:"False"
      },{
        id:3,
        title:"Cook Food",
        completed:"False"
      },{
        id:4,
        title:"Book Train",
        completed:"False"
      }
    ]
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Application</h1>
        <Todos />
      </header>
    </div>
  );
}

export default App;
